            const maindomains = maindomainsText.split('\n').map(item => item.trim()).filter(item => item);

            // Arrays to store results
            const matchedMainDomains = [];
            const unmatchedSubdomains = [];

            // Compare subdomains against main domains
            for (const subdomain of subdomains) {
                let matched = false;
                for (const mainDomain of maindomains) {
                    if (subdomain.endsWith(mainDomain)) {
                        matchedMainDomains.push(mainDomain);
                        matched = true;
                        break;
                    }
                }
                if (!matched) {
                    unmatchedSubdomains.push(subdomain);
                }
            }

            // Output results

            document.getElementById('unmatched').value = unmatchedSubdomains.join('\n');
